export default {
  title: 'Wan Policies settings schema',
  type: 'object',
  properties: {
    criteria: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          type: { type: 'string' },
          attribute: { type: 'string' },
        },
      },
      additionalProperties: true,
    },
    description: { type: 'string' },
    name: { type: 'string' },
    createdesc: { type: 'string', required: false },
    enabled: { type: 'boolean', required: false },
    interfaces: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          interfaceId: { type: 'integer' },
        },
      },
    },
    type: { type: 'string' },
    best_of_metric: { type: 'string' },
    balance_algorithm: { type: 'string', required: false },
  },
  required: ['criteria', 'description', 'name', 'interfaces', 'type', 'best_of_metric'],
  additionalProperties: false,
}
